import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Announcements from './pages/Announcements';
// other imports...

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/announcements" component={Announcements} />
        {/* Other routes */}
      </Switch>
    </Router>
  );
}

export default App;
